import React from 'react';
import "../../App.css"
import imgslider from "../../images/banner.jpg";
const Slider = () => {
    return (
        <>
        <div className="container">
          <div className="row">
              <div className="img1">
              <img src={imgslider} />
              </div>
          </div>
        </div>


        </>
    )
}

export default Slider
